export default function PersonalSkills(langague: string) {
    const json = {
        'pt-br': {
            componentLabel: 'Habilidades',
            skills:[
                {name: 'HTML',stars: 5},
                {name: 'CSS/SASS/BOOTSTRAP',stars: 5},
            ]

        },
        'en': {
            componentLabel: 'Skills',
            skills:[
                {name: 'HTML',stars: 5},
                {name: 'CSS/SASS/BOOTSTRAP',stars: 5},
            ] 
        }
    };

        if (langague == 'en') {
            return json['en'];
        }
        return json['pt-br'];
};
